import axios from "axios";
import { useSelector } from "react-redux";
import { baseURL } from "../../apiurl";
import { videoBoardReducers } from "../reducers/videoBoard_reducer";
//
function getVideoBoardList(currentPage) {
  return async (dispatch) => {
    const videoBoard = useSelector((state) => state.videoBoard);
    const data = await axios
      .get(
        `${baseURL}/admin/videoBoard/list/${videoBoard.videoNum}/${currentPage}`
      ) // 임시주소
      .then((response) => response.data); // 값 받기

    console.log(data);
    dispatch(videoBoardReducers.getVideoBoardList({ data }));
  };
}

export const videoBoardActions = {
  getVideoBoardList,
};
